import React, { Component } from 'react';
import Post from './Post'

export default class Posts extends Component {

  showUsers = () => {
    return this.props.users.map(function (user) {
      return <div>{user.name}</div>
    })
  }

  render() {

    return (
      <div className="image-feed">
        {this.showUsers()}
      </div>
    );
  }
}
